"use client";
import { alertTypes, useAlert } from "@/context/alertContext";
import Link from "next/link";
import  { useState } from "react";
import { useForm } from "react-hook-form";
import LogoSVG from "@/app/common_components/logoSVG";
import { axiosInstance } from "@/lib/axios";
import { API_ROUTES } from "@/utils/routes";

function ForgetPassword() {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  const [pendingStatus, setPendingStatus] = useState(false); //to indicate submission process
  const { triggerAlert } = useAlert(); // to triger alert when sign up successfuly/failed

  const onSubmit = async (data) => {
    try {
      const { email } = data;
      // Set pending status to true to indicate submission process
      setPendingStatus(true);

      const response = await axiosInstance.post(API_ROUTES.forgetPassword, {
        email,
      });

      if (response.status === 200) {
        triggerAlert({
          title: "Instruction sent",
          message: "Look up you email inbox and follow the instruction",
          type: alertTypes.success,
        });
      setPendingStatus(false);
      }
    } catch (error) {
      // Reset pending status in case of an error
      setPendingStatus(false);
      console.error(error);

      // Check error response and handle specific status codes
      if (error.response) {
        const { status } = error.response;

        // Handle specific error statuses
        if (status === 404) {
          triggerAlert({
            title: "User not found",
            message: "No user found with the provided email address.",
            type: alertTypes.error,
          });
        } else if (status === 500) {
          triggerAlert({
            title: "Server Error",
            message:
              "An internal server error occurred. Please try again later.",
            type: alertTypes.error,
          });
        } else {
          // Generic error message for other statuses
          triggerAlert({
            title: "Procedure Failed",
            message: "Something went wrong. Please try again.",
            type: alertTypes.error,
          });
        }
      } else {
        // Handle cases where there is no response (e.g., network errors)
        triggerAlert({
          title: "Network Error",
          message: "Please check your internet connection and try again.",
          type: alertTypes.error,
        });
      }
    }
  };

  return (
    <div className="h-screen overflow-y-scroll flex flex-col">
      {/* header banner */}
      <div className="bg-gradient-to-l from-[#201348] to-[#0D0D1B] px-5 py-6">
        <LogoSVG />
        <h3 className="text-grad mt-4 text-2xl font-bold bg-gradient-to-r from-white to-[#ffffff98] inline-block text-transparent bg-clip-text">
          {/* adding gradiant to text */}
          Forget password
        </h3>
        <h6 className="mt-2 text-sm font-light text-white">
          Enter the email address you used to register with
        </h6>
      </div>
      {/* body */}
      <div className="px-5 py-6 relative h-[calc(100%-16.5rem)]">
        {/* Login/sign up sitcher */}
        <div className="flex justify-center">
          <LockSVG />
        </div>

        {/* Forms => transform on x axis when switch betweenn sign up and login */}
        <div className="h-full">
          <p className="font-bold mt-3 text-sm text-center">
            Enter your email for instructions
          </p>
          <div className="flex flex-col h-full">
            <form
              className="flex flex-col justify-between h-full max-h-[calc(100vh-24rem)]"
              onSubmit={handleSubmit(onSubmit)}
            >
              {/* grow flex to push the login button to the bottom */}
              <div className="flex-grow">
                {/* Email Input */}
                <div className="mt-6">
                  <label className="block text-sm font-medium" htmlFor="email">
                    Email
                  </label>
                  <input
                    {...register("email", {
                      required: "Email is required",
                      pattern: {
                        value: /^\S+@\S+$/i,
                        message: "Invalid email address",
                      },
                    })}
                    type="email"
                    id="email"
                    className={`mt-2 block w-full px-4 py-2 border ${
                      errors.email ? "border-red-500" : "border-gray-300"
                    } rounded-lg shadow-sm focus:outline-none focus:ring-indigo-500 focus:border-indigo-500`}
                  />
                  {errors.email && (
                    <span className="text-red-500 mt-2 text-sm">
                      {errors.email.message}
                    </span>
                  )}
                </div>
              </div>

              {/* Submit Button */}
              <button
          type="submit"
          className={`relative min-h-12 w-full py-3 text-white rounded-lg shadow-sm flex items-center justify-center ${pendingStatus?"bg-[#5848a8d0]":"bg-[#5848A8]"}`}
        >
          {pendingStatus ? <div className="loader"></div> : "Send  instructions"}
                <span className="absolute left-[50%] translate-x-[-50%] bottom-0 translate-y-1/2 w-28 h-7 bg-[#cccbd365] rounded-full blur-[12px]"></span>
              </button>
            </form>
            <div className="my-4 text-center flex justify-center items-center">
              <Link href={"/auth"} className="text-base">
                Back to sign in
              </Link>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ForgetPassword;

function LockSVG() {
  return (
    <svg
      width="106"
      height="105"
      viewBox="0 0 106 105"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
    >
      <rect
        x="0.5"
        width="105"
        height="105"
        rx="52.5"
        fill="#618CE6"
        fillOpacity="0.08"
      />
      <rect
        x="24.5"
        y="25"
        width="57"
        height="56"
        fill="url(#pattern0_117_425)"
      />
      <defs>
        <pattern
          id="pattern0_117_425"
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <use
            xlinkHref="#image0_117_425"
            transform="matrix(0.00490196 0 0 0.0049895 -0.982456 -0.553571)"
          />
        </pattern>
        <image
          id="image0_117_425"
          width="612"
          height="408"
          xlinkHref="data:image/png;base64,"
        />
      </defs>
    </svg>
  );
}
